import HeaderComp from "components/HeaderComp";
import SidebarComp from "components/Sidebar";
import React from "react";

const DashboardLayout = ({ children }) => {
  return (
    <div className="dashboard">
      <HeaderComp />
      <SidebarComp />
      {children}
    </div>
  );
};

export default DashboardLayout;
